void solve(std::vector<std::vector<char>>& map, int startx, int starty, int prevx, int prevy){
    if(map[startx+1][starty] != '#') solve(map, startx+1, starty, startx, starty);
    if(map[startx-1][starty] != '#') solve(map, startx-1, starty, startx, starty);
    if(map[startx][starty+1] != '#') solve(map, startx, starty+1, startx, starty);
    if(map[startx][starty-1] != '#') solve(map, startx, starty-1, startx, starty);
    
    return;
}